svg.script:

function toggleAnimation(toggle){
var svg = document.getElementById("svg8");
var wait;
  if(toggle){
    svg.classList.add("animate");
    wait=5*1000;
  }
  else{
    svg.classList.remove("animate");
    wait=1000;
  }
  setTimeout(function(){
    toggleAnimation(!toggle);
  },wait);
}
toggleAnimation(true);
